// React core
import React from "react";

export default function Package({data}) {

    const {
        id,
        status,
        eta,
        parcel_id,
        sender,
        location_name,
    } = data;

  return (
    <article className="package">
        <h3 className="parcel_id">This is {parcel_id}</h3>
        <div className="parcel_details">
        <p >{status}</p>
        <p >{eta}</p>
        <p >{sender}</p>
        <p >{location_name}</p>
        </div>
    </article>
  );
}
